import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import style from './Favorites.module.css';

const Favorites = () => {
  const { myFavorites } = useSelector((state) => state);
  const handleClick = ()=> {
    navigate('/home');
 }
  return (
    <div>
      {myFavorites.map((character) => {
        return (
          <div>
          <button className={style.backHome} onClick={handleClick} >Back to home</button>
          <img
              src={character.image}
              alt={character.name}
              className={style.imageContainer}
            />
            <div className={style.title}>Name: {character.name}</div>
            <div className={style.title}>Specie: {character.species}</div>
            <div className={style.title}>Gender: {character.gender}</div>
            
          </div>
        );
      })}
    </div>
  );
};

export default Favorites;
